import logo from './logo.svg';
import './App.css';
import { Inicio } from './home/inicio';
import { Route, Router } from 'react-router-dom';

function App() {
  return (
  <>
  <Router>
    <Routes>
      <Route path='/' element={<Inicio></Inicio>}>

      </Route>
    </Routes>
  </Router>
  <Inicio></Inicio>
  </>
  );
}

export default App;
